      | 55783 -> { ItemTypeData.id= 55783; name= "RFS Maiori Kul-Brutor"; published= false; description= "A legendary figure in the lore of the Brutor Tribe, Maiori Kul-Brutor is believed to have been either the first woman to set foot on Kulheim (Pator VII), or the Chief of the Kul-Brutor Clan that sponsored an effort by the old Minmatar Empire to terraform and colonize the planet. The Great Clan of Kul-Brutor was dispersed by the events of the Amarr Conquest and Kulheim remains a barren world today.    <i> The liberty of our people is solely our responsibility. Tempting as it is to foist this burden upon our well-wishers, we must never forget that the onus of our emancipation rests with us and us alone. For too long, our proud people have been subjugated to the whims of enslavers, forced to endure relentless suffering and humiliation at the hands of people whose motivations, masked though they may be by florid religious claptrap, remain as base and despicable as those of the playground bully. If ever there was a time to rise – if ever there was a time to join hands with our brothers – that time is now. At this exact junction in history we have within our grasp the means to loosen our tormentors' hold and win freedom for our kin. Opportunities are there to be taken. Brothers, we must rise. </i> – Maleatu Shakor, Republic Parliament Head, speaking before the Tribal Council, November 27th, YC 107"; marketGroupId= None; groupId= 226; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 8900.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(2906); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 8900.000000; volume= 0.000000 } |> Some
